import './Tours.css'
import Tour from "./tour/Tour.js";


import React from "react";


const Tours = ({ tours }) => {
    return (
      <>
        {tours.map(tour => (
          <Tour key={tour.id} tour={tour} />
        ))}
      </>
    );
  };
  export default Tours;

  {
    props.arrayData.map((item, i) => {
        return (
            <div key={i}>
                <h3>{item.name}</h3>
                <img src={item.image} alt={item.name} />
            </div>
        )
    })
}
